import React, { Component } from 'react'
import Login from './connexion/Login';
import PageAccueil from './pageAccueil/PageAccueil';
import SignIn from './enregistrement/SignIn'
import Utilisateur from './utilisateur/Utilisateur'

class NavigationPanel extends Component {
    constructor(props) {
        super(props)
    }

    render() {
        if (this.props.isConnected) {
            if (this.props.page === 'pageAccueil') {
                return <PageAccueil changePage={this.props.changePage} setLogout={this.props.logout} />
            }
            if (this.props.page === 'utilisateur') {
                return <Utilisateur changePage={this.props.changePage} setLogout={this.props.logout} />
            }
        } else {
            if (this.props.page === 'connexion') {
                return <Login changePage={this.props.changePage} getConnected={this.props.login} />
            }
            if (this.props.page === 'inscription') {
                return <SignIn changePage={this.props.changePage} getConnected={this.props.login} />
            }
        }
        
    }
}

export default NavigationPanel;
